import { useState, useEffect, useRef } from "react";
import { Link, NavLink, useNavigate } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { logout } from "../redux/slices/authSlice";

export default function Header() {
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const { userInfo, isAuthenticated } = useSelector((state) => state.auth);
  const [menuOpen, setMenuOpen] = useState(false);
  const menuRef = useRef(null);
  console.log("User Info in Header:", userInfo);
  // Close menu when clicking outside
  useEffect(() => {
    const handleClickOutside = (event) => {
      if (menuRef.current && !menuRef.current.contains(event.target)) {
        setMenuOpen(false);
      }
    };
    document.addEventListener("click", handleClickOutside);
    return () => {
      document.removeEventListener("click", handleClickOutside);
    };
  }, []);

  // Handle sign out
  const handleLogout = () => {
    dispatch(logout());
    navigate("/login");
  };

  return (
    <div className="header-container">
      <div className="container-fluid">
        <div className="header">
          <div className="logo">
            <Link to="/">
              <img
                src={`${process.env.PUBLIC_URL}/assets/images/aayologo.png`}
                alt="Aayo"
              />
            </Link>
          </div>

          <div className="nav">
            <ul>
              <li>
                <NavLink
                  to="/"
                  className={({ isActive }) => (isActive ? "active" : "")}
                  end
                >
                  Home
                </NavLink>
              </li>
              <li>
                <NavLink
                  to="/deals"
                  className={({ isActive }) => (isActive ? "active" : "")}
                >
                  Deals & Offers
                </NavLink>
              </li>
              <li>
                <NavLink
                  to="/features"
                  className={({ isActive }) => (isActive ? "active" : "")}
                >
                  Features
                </NavLink>
              </li>
              <li>
                <NavLink
                  to="/about"
                  className={({ isActive }) => (isActive ? "active" : "")}
                >
                  About Us
                </NavLink>
              </li>
              <li>
                <NavLink
                  to="/how-it-works"
                  className={({ isActive }) => (isActive ? "active" : "")}
                >
                  How It Works
                </NavLink>
              </li>
              <li>
                <NavLink
                  to="/contact"
                  className={({ isActive }) => (isActive ? "active" : "")}
                >
                  Contact Us
                </NavLink>
              </li>
            </ul>
          </div>

          <div className={`button ${menuOpen ? "active" : ""}`} ref={menuRef}>
            {!userInfo ? (
              <>
                <Link to="/login" className="btn btn-fill">
                  Login or Create Account
                </Link>
                {/* <Link to="/login" className="btn btn-fill">
                  Sign Up
                </Link> */}
              </>
            ) : (
              <>
                <button
                  type="button"
                  className="btn btn-blank usermenu-toggle"
                  onClick={() => setMenuOpen(!menuOpen)}
                >
                  <img
                    src={`${process.env.PUBLIC_URL}/assets/images/thumb-driver.png`}
                    alt={userInfo?.user?.name || "User"}
                  />
                  {userInfo?.user?.name || "User"}{" "}
                  <span className="material-icons-outlined">
                    arrow_drop_down
                  </span>
                </button>

                {menuOpen && (
                  <div className="usermenu-toggle-content">
                    <ul>
                      <li>
                        <Link to="/dashboard">My Bookings</Link>
                      </li>
                      <li>
                        <Link to="/profile">Profile</Link>
                      </li>
                      <li>
                        <Link to="/change-password">Change Password</Link>
                      </li>
                      <li>
                        <button
                          type="button"
                          onClick={handleLogout}
                          className="btn btn-link"
                        >
                          Sign Out
                        </button>
                      </li>
                    </ul>
                  </div>
                )}
              </>
            )}
          </div>
        </div>
      </div>
    </div>
  );
}
